import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import Navbar from './components/Navbar';
import Items from './components/Items'
import reportWebVitals from './reportWebVitals';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import articles from './components/articles.json';

const articlesComp = [];
fetch('./data/data.json')
.then((response) => response.json())
.then((findresponse)=>{
  console.log(findresponse.title)
  this.setState({
    data:findresponse.title,
  })
})
for(const article of articles)
{
  const {id,name,description,seller,photo} = article
  articlesComp.push(<Items id = {id} name = {name} description = {description} seller = {seller} photo={photo}/>)
}

const root = ReactDOM.createRoot(document.getElementById('root'));

root.render(
  <React.StrictMode>
    <Navbar/>

  </React.StrictMode>
);

